column8:
★コラントッテ×エマートの医療機器認証シューズ！<br>
<br>
●土踏まず部分に磁石4つをコラントッテ独自のN極S極交互配列で配置！磁力は広い範囲に影響し、血行を改善、コリを緩和します。<br>
●血行の改善で疲労物質が溜まるのを軽減し、むくみの防止効果も！<br>
●履き口にはクッション材を使用し、フィット感を向上。履き始めの靴擦れリスクを軽減します。<br>
●軽量でクッション性の良いオリジナルアウトソール。溝を深くし、防滑性を高めています！<br>
●トゥ(つま先)はゆったり幅広設計(4E)！<br>
●内側と外側にゴムがついたスリッポンタイプで着脱らくらく！<br>
●立ち仕事や外回りの多い人は勿論、日常のあらゆるシーンで活躍する履く医療機器！<br>
<br>
■素材<br>
アッパー：天然皮革<br>
ソール：合成底<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■サイズ 24.5cm～27.0cm<br>
<br><br>
