●クッション性に優れた、軽量・幅広で足なじみの良いレディスモデル。
●アッパーは足の形になじみやすい天然皮革製。
●3Eウイズ相当のワイドラストを採用し、ゆったりした足入れを実現。
●脱ぎ履きしやすいファスナー付きモデル。
●T-GEL（かかと部）：クッション性
●SEW MIDSOLE（SEWミッドソール）：クッション性
●TRUSSTIC（トラスティック）：安定性
●AHAR PLUS（エーハープラス）：耐久性
●はっ水加工アッパー
●AMFIT（アムフィット対応）：ホールド・フィット性
●エコプラン：人に優しい環境配慮型対応商品です。<br>●インナーソール：取り替え式
●適合する別売中敷：TIZ403・TIZ404・TIZ405
●ファスナー付<br>●アッパー素材：
・本体：天然皮革製
・補強：天然皮革製
